function testFirstReading(title, testAction, iterationsCount = 1)
{
	const elapsedList = [];
	let count = 0;
	let sourceData = buildData();

	while (count < iterationsCount)
	{
		p.mark("start");
		testAction(sourceData);
		p.mark("end");

		p.measure("elapsed", "start", "end");
		const entries = p.getEntriesByName("elapsed");
		elapsedList.push(entries[entries.length - 1].duration);

		sourceData = cloneData(sourceData);
		count++;
	}

	writeResults(title, sourceData.count(), elapsedList);
}

function testFirstReadingAndSubsequents(title, testAction, iterationsCount = 1) {
	const elapsedList = [];
	let count = 0;
	let sourceData = buildData();

	while (count < iterationsCount)
	{
		p.mark("start");
		testAction(sourceData);
		p.mark("end");

		p.measure("elapsed", "start", "end");
		const entries = p.getEntriesByName("elapsed");
		elapsedList.push(entries[entries.length - 1].duration);

		count++;
	}

	writeResults(title, sourceData.count(), elapsedList);
}



function writeResults(title, itemsCount, elapsedList) {
	console.log(" ");
	console.log("----------------------------------------");
	console.log(`### ${title} ###`);
	console.log("----------------------------------------");
	console.log(`items count: ${itemsCount}`);
	console.log("----------------------------------------");
	for (let i = 0; i < elapsedList.length; i++) {
		console.log(`iteration ${i}: ${elapsedList[i]} ms`);
	}
	console.log("----------------------------------------");
	console.log(`average time: ${average(elapsedList)} ms`);
	console.log(`average time (excluding first): ${average(elapsedList.slice(1))} ms`);
	console.log("----------------------------------------");
}

function cloneData(data) {
	const result = [];
	let i = 0;
	for (const item of data)
	{
		result[i++] = {
			firstName: item.firstName,
			lastName: item.lastName,
			companyName: item.companyName,
			address: item.address,
			city: item.city,
			county: item.county,
			state: item.state,
			zip: item.zip,
			phone1: item.phone1,
			phone2: item.phone2,
			email: item.email,
			web: item.web
		};
	}
	return Linq.Enumerable.from(result);
}

function buildData() {
	const result = [];
	for (var i = 0; i < SourceDataLength; i++)
	{
		result[i] = {
			firstName: firstNameList[getRandomIndex(firstNameList.Length)],
			lastName: lastNameList[getRandomIndex(lastNameList.Length)],
			companyName: companyNameList[getRandomIndex(companyNameList.Length)],
			address: addressList[getRandomIndex(addressList.Length)],
			city: cityList[getRandomIndex(cityList.Length)],
			county: countyList[getRandomIndex(countyList.Length)],
			state: stateList[getRandomIndex(stateList.Length)],
			zip: zipList[getRandomIndex(zipList.Length)],
			phone1: phone1List[getRandomIndex(phone1List.Length)],
			phone2: phone2List[getRandomIndex(phone2List.Length)],
			email: emailList[getRandomIndex(emailList.Length)],
			web: webList[getRandomIndex(webList.Length)],
		};
	}
	return Linq.Enumerable.from(result);
}

function getRandomIndex(count) {
	return Math.round(Math.random() * (count - 1));
}

function average(values) {
	let t = 0;
	for (const v of values) {
		t += v;
	}
	return t / values.length;
}



